  - id: 113
    name: Q2 Data Dictionary
    description: "Variables can be uniquely identified by the *domain* and \r\n*variable
      name*. Note this information if you are considering making a data request, \r\nin
      order to quickly select the variables in the request later.\r\n\r\nIf you are
      planning on making a data request, you may find it more \r\nexpedient to fill
      out the data request form and select the required \r\nvariables directly.\r\n\r\n"
    sql: "\r\n\r\nselect distinct\r\n  cb.id,\r\n  cb.variable_name \"variable name\",\r\n
      \ cb.domain \"domain\",\r\n  cb.field_type_sa \"type\",\r\n  cb.field_label
      \"label\",\r\n  cb.field_attributes \"attributes\",\r\n  cb.field_note \"field
      note\",\r\n  '[q2_data](/reports/reference_data__table_data'||chr(63)||'search_attrs[_blank]=true&schema_name=q2&table_name=q2_data)'
      \"table\"\r\nfrom q2.q2_datadic cb\r\n\r\nwhere\r\n  (\r\n    (\r\n      (:domain)
      is NULL OR cb.domain IN (:domain)\r\n    )\r\n    AND (\r\n      :name_or_label_contains
      is NULL \r\n      OR cb.variable_name ~* :name_or_label_contains\r\n      OR
      cb.field_label ~* :name_or_label_contains      \r\n    )\r\n  )\r\norder by
      \r\ncb.id;\r\n"
