  - id: 132
    name: Search for a Page
    description: ''
    sql: "select  \r\n\r\ndistinct on (result)\r\n\r\n'[' || alsip.title || ']' ||\r\n'(/content/page/'
      || sip.study_info_id || '/' || alsip.slug || ')' result\r\n,\r\n\r\nCASE \r\nWHEN
      sps.title ~* replace(:search, ' ', '|') OR sps.content ~* replace(:search, '
      ', '|')\r\nTHEN sps.title || '\r\n' || left(sps.content, 250)\r\nWHEN alsip.title
      ~* replace(:search, ' ', '|') OR alsip.description ~* replace(:search, ' ',
      '|')\r\nTHEN alsip.title || '\r\n' || left(alsip.description, 150)\r\nWHEN nssf.title
      ~* replace(:search, ' ', '|') OR nssf.description ~* replace(:search, ' ', '|')\r\nTHEN
      nssf.title || '\r\n' || left(nssf.description, 150)\r\nEND\r\n\r\ndescription\r\n\r\nfrom
      activity_log_study_info_parts alsip\r\n\r\ninner join study_info_parts sip\r\non
      sip.master_id = alsip.master_id\r\n\r\nleft join model_references mr\r\non \r\n
      \ NOT coalesce(mr.disabled, false)  \r\n  AND mr.from_record_type = 'ActivityLog::StudyInfoPart'\r\n
      \ AND mr.to_record_type = 'DynamicModel::StudyPageSection'\r\n  AND alsip.id
      = mr.from_record_id\r\n  \r\nleft join study_page_sections sps\r\non\r\n  sps.id
      = mr.to_record_id\r\n\r\nleft join model_references mr2\r\non \r\n  NOT coalesce(mr2.disabled,
      false)  \r\n  AND mr2.from_record_type = 'ActivityLog::StudyInfoPart'\r\n  AND
      mr2.to_record_type = 'NfsStore::Manage::Container'\r\n  AND alsip.id = mr2.from_record_id\r\n
      \ \r\nleft join nfs_store_containers nsc\r\non\r\n  nsc.id = mr2.to_record_id\r\n\r\nleft
      join nfs_store_stored_files nssf\r\non\r\n  nssf.nfs_store_container_id = nsc.id\r\n\r\nwhere
      \r\nalsip.title ~* replace(:search, ' ', '|')\r\nOR alsip.description ~* replace(:search,
      ' ', '|')\r\n\r\nOR sps.title ~* replace(:search, ' ', '|')\r\nOR sps.content
      ~* replace(:search, ' ', '|')\r\n\r\nOR nssf.title ~* replace(:search, ' ',
      '|')\r\nOR nssf.description ~* replace(:search, ' ', '|')\r\n\r\n\r\nLIMIT 20;\r\n"
    search_attrs: "\r\n\r\nsearch: \r\n  text: \r\n    all: true\r\n    multiple:
      single\r\n    #single\r\n    disabled: false\r\n\r\n"
